let counter = 0;
/**
 * Создает экземпляр оборудования для таблицы
 * @param  {String} model                   модель
 * @param  {String} serial                  серийный номер
 * @param  {String} type                    тип
 * @param  {String} front                   тип фронтальной плоскости
 * @param  {String} [completeness="Полная"] комплектность
 * @param  {Number} [cost=999999]           стоимость
 * @param  {String} [location="Москва"]     расположение
 * @param  {Date}   [date=new               Date(]        Дата
 * @return {[type]}                         [description]
 */
function createData(
  model,
  serial,
  type,
  front,
  completeness = "Полная",
  cost = 999999,
  location = "Москва",
  date = new Date()
) {
  counter += 1;
  return {
    id: counter,
    model,
    serial,
    type,
    front,
    completeness,
    cost,
    location,
    date
  };
}

/**
 * Набор данных для заголовков таблицы
 * @type {Array}
 */
const columnData = [
  {
    id: "model",
    numeric: false,
    disablePadding: true,
    label: "Модель"
  },
  {
    id: "serial",
    numeric: true,
    disablePadding: false,
    label: "Серийный номер"
  },
  { id: "type", numeric: true, disablePadding: false, label: "Тип" },
  {
    id: "front",
    numeric: true,
    disablePadding: false,
    label: "Тип фронтальной панели)"
  },
  {
    id: "completeness",
    numeric: true,
    disablePadding: false,
    label: "Комплектность"
  },
  {
    id: "cost",
    numeric: true,
    disablePadding: false,
    label: "Стоимость"
  },
  {
    id: "location",
    numeric: true,
    disablePadding: false,
    label: "Локация"
  },
  {
    id: "date",
    numeric: true,
    disablePadding: false,
    label: "Дата"
  }
];

/**
 * Компонент шапки таблицы
 * @extends React
 */
class EnhancedTableHead extends React.Component {
  static propTypes = {
    numSelected: PropTypes.number.isRequired,
    onRequestSort: PropTypes.func.isRequired,
    onSelectAllClick: PropTypes.func.isRequired,
    order: PropTypes.string.isRequired,
    orderBy: PropTypes.string.isRequired,
    rowCount: PropTypes.number.isRequired
  };
  /**
   * Обработчик сортировки в шапке таблицы
   * @param  {String} property поле сортировки
   * @param  {SytheticEvent} event
   */
  createSortHandler = property => event => {
    this.props.onRequestSort(event, property);
  };
  /**
   * render
   * @return {ReactElement} разметка
   */
  render() {
    const {
      onSelectAllClick,
      order,
      orderBy,
      numSelected,
      rowCount
    } = this.props;

    return (
      <TableHead>
        <TableRow>
          <TableCell padding="checkbox">
            <Checkbox
              indeterminate={numSelected > 0 && numSelected < rowCount}
              checked={numSelected === rowCount}
              onChange={onSelectAllClick}
            />
          </TableCell>
          {columnData.map(column => {
            return (
              <TableCell
                key={column.id}
                numeric={column.numeric}
                padding={column.disablePadding ? "none" : "default"}
              >
                <Tooltip
                  title="Сортировка"
                  placement={column.numeric ? "bottom-end" : "bottom-start"}
                  enterDelay={300}
                >
                  <TableSortLabel
                    active={orderBy === column.id}
                    direction={order}
                    onClick={this.createSortHandler(column.id)}
                  >
                    {column.label}
                  </TableSortLabel>
                </Tooltip>
              </TableCell>
            );
          }, this)}
        </TableRow>
      </TableHead>
    );
  }
}

const toolbarStyles = theme => ({
  root: {
    paddingRight: 2
  },
  highlight:
    theme.palette.type === "light"
      ? {
          color: theme.palette.secondary.A700,
          backgroundColor: theme.palette.secondary.A100
        }
      : {
          color: theme.palette.secondary.A100,
          backgroundColor: theme.palette.secondary.A700
        },
  spacer: {
    flex: "1 1 100%"
  },
  actions: {
    color: theme.palette.text.secondary
  },
  title: {
    flex: "0 0 auto"
  }
});

/**
 * Панель выбора значений (выпадает при клике на чекбокс)
 * @param {[type]} props
 * @return {ReactElement} разметка
 */
let EnhancedTableToolbar = props => {
  const { numSelected, classes } = props;

  return (
    <Toolbar
      className={classNames(classes.root, {
        [classes.highlight]: numSelected > 0
      })}
    >
      <div className={classes.title}>
        {numSelected > 0 ? (
          <Typography type="subheading">
            Выбрано устройств: {numSelected}
          </Typography>
        ) : (
          <Typography type="title">Устройства</Typography>
        )}
      </div>
      <div className={classes.spacer} />
      <div className={classes.actions}>
        {numSelected > 0 ? (
          <Tooltip title="Удалить">
            <IconButton aria-label="Delete">
              <DeleteIcon />
            </IconButton>
          </Tooltip>
        ) : (
          <Tooltip title="Фильтры">
            <IconButton aria-label="Фильтры">
              <FilterListIcon />
            </IconButton>
          </Tooltip>
        )}
      </div>
    </Toolbar>
  );
};

EnhancedTableToolbar.propTypes = {
